window.bookSummaryJSON = "<p><b>This isn’t her idea of home, but she’s quickly becoming mine.</b></p> <p>I’m Never Harbor’s neighborhood best friend. Along with being the middle child in a loud family of seven, I’m accustomed to being everything to everyone. But after moving into my new townhouse by the sea, my world has suddenly grown too quiet.</p> <p>But then she moves back to town.</p> <p>Marina Starkey is my landlord’s daughter with nowhere to go. She needs a place to stay for the summer, and thankfully I’m just the kind of guy to offer.</p> <p>Hello there, new roommate.</p> <p>She’s gorgeous and cheeky with a stubbornness that matches my own. (Don’t get me started on the shared bed situation.) Summer days pass in soft touches and afternoon swims, and my heart sinks deeper with every stroke.</p> <p>I’m not a temporary fling kind of guy, and Marina has no intention of staying past the summer.</p> <p>She doesn’t want to fall in love with her hometown, and I’m basically Mr. Never Harbor himself.</p> <p>But my home is quickly becoming wherever I’m with her.</p> <p><i>OUT WITH THE TIDE is book two in Never Harbor, a series of interconnected stand-alone contemporary romances inspired by Peter Pan.</i></p>"; 
